import React, { Component } from 'react';
import { Container, Row, Col, Card, Button } from 'react-bootstrap';
class Home extends Component {
    constructor(props) {
        super(props);
        this.state = {
            products: [
                {
                    name: 'Nike Air Max 90',
                    price: '$120',
                    description: 'Classic Nike shoes with a comfortable fit.',
                    imgUrl: 'https://images.nike.com/is/image/DotCom/PDP_HERO_M/AO7293_600_A_PREM/air-max-90-leather-shoe.jpg',
                },
                {
                    name: 'Adidas Ultraboost 19',
                    price: '$180',
                    description: 'Lightweight and comfortable running shoes by Adidas.',
                    imgUrl: 'https://assets.adidas.com/images/h_840,f_auto,q_auto:sensitive,fl_lossy/ade1cd71d2b44c0e9bdbab81010db7bd_9366/Ultraboost_19_Shoes_Black_F35239_01_standard.jpg',
                },
                // Add more products here
            ],
        };
    }

    render() {
        const { products } = this.state;
        return (
            <div className="container">
                <div className="row">
                    {products.map((product) => (
                        <div className="col-md-4 mb-3">
                            <Card>
                                <CardImg top width="100%" src={product.imgUrl} alt={product.name} />
                                <CardBody>
                                    <CardTitle>{product.name}</CardTitle>
                                    <CardSubtitle>{product.price}</CardSubtitle>
                                    <CardText>{product.description}</CardText>
                                    <Button color="primary">Add to Cart</Button>
                                </CardBody>
                            </Card>
                        </div>
                    ))}
                </div>
            </div>
        );
    }
}

export default Home;
